import './App.css';
import {useState} from 'react'

function App() {
  const [state, setState] = useState(false)

  return (
    <div className="App">
      <h1>Hello world
      <i class="fa-regular fa-user"></i>
      </h1>
      <button onClick={() => setState(!state)}>
        {state ? "Đã nhận thành công" : "Nhận"}
      </button>
    </div>
  );
}
export default App;
